import Heading from "./components/Heading";
import Note from "./components/Note";
import Footer from "./components/Footer";

import notes from "./notes";

export default function App() {
  return (
    <div>
      <Heading />
      <div className="row">
        {notes.map((note) => (
            <Note title={note.title} content={note.content} />
          ))};
      </div>
      <Footer />
    </div>
  );
}
